import React, { useState } from 'react';

const SearchBar = ({ onSearch }) => {
  const [brandOrModel, setbrandOrModel] = useState('');

  const handleSearch = () => {
    onSearch(brandOrModel);
  };

  return (
    <div>
      <label htmlFor="brandOrModel">Enter brand/model: </label>
      <input
        type="text"
        id="brandOrModel"
        value={brandOrModel}
        onChange={(e) => brandOrModel(e.target.value)}
        placeholder="Enter brand/ model"
      />
      <button onClick={handleSearch}>Search</button>
    </div>
  );
};

export default SearchBar;
